    var firstWord = originalHighCat.split('_')[0].charAt(0).toUpperCase() + originalHighCat.split('_')[0].slice(1);
    var secondWord = originalHighCat.split('_')[1].charAt(0).toUpperCase() + originalHighCat.split('_')[1].slice(1);
